var b="url",c="مشاهده_فرصت_های_شغلی_آگهی_های_استخدام_.html",d="generationDate",e=new Date(1764584715998.3),f="defaultAdaptiveView",g="name",h="",i="size",j="width",k=0,l="height",m="adaptiveViews",n="sketchKeys",o="s0",p="variables",q="OnLoadVariable",r="currentTime",s="Loginv",t="page",u="packageId",v="7a9b6bd8900e49faafc06e9cff76dec6",w="type",x="Axure:Page",y="مشاهده فرصت های شغلی(آگهی های استخدام)",z="notes",A="annotations",B="fn",C="1",D="ownerId",E="label",F="Note",G="<p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\">گزینه فرصت های شغلی می تواند در صفحه اصلی سامانه جذب و استخدام برای کارجو قابل نمایش باشد.همچنین می توان یک دامین جداگانه بر روی دامین سامانه جذب و استخدام ثبت نموده و فرصت های شغلی(آگهی های&nbsp; استخدام) را بر روی آن بارگذاری نمود مانند دامین زیر</span></p><p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\"><br></span></p><p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;color:#FF0000;\">employment.sgpco.com</span></p><p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;color:#FF0000;\">سامانه فرصت های شغلی گروه صنایع گیتی پسند</span></p>",H="2",I="2db479196fdb4e5e8bce3294916c8dad",J="(Shape)",K="<p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\">با اولین ثبت نام،&nbsp; کارجو دارای یک پروفایل در سامانه فرصت های شغلی گروه صنایع گیتی پسند می گردد.این پروفایل در مراحل بعد پس از ارسال رزومه برای هر فرصت شغلی توسط کارجو جهت اطلاع رسانی به وی استفاده می گردد</span></p>",L="3",M="72307b03d9cf436db1680f688e761248",N="(Text Field)",O="<p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\">با کلیک کارجو&nbsp; بر روی دکمه &quot;</span><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;color:#FF0000;\">ورود | ثبت نام</span><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\">&quot; کارجو به صفحه لاگین هدایت و با وارد نمودن کد ملی و شماره تلفن همراه خود احراز هویت گردد</span></p><p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\">(OPT احراز هویت پیامکی)</span></p><p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;color:#FF0000;\">سپس </span><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\">چک گردد که آیا کارجو قبلا با این کد ملی در سامانه فرصت های شغلی ثبت نام و ورود اطلاعات انجام داده است یا </span></p><p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\">خیر؟</span></p><p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;color:#3800FF;\">در صورتی که کارجو قبلا در سامانه فرصت های شغلی ثبت نام نکرده بود به فرم &quot;ثبت نام کارجو &quot; (نمایش این فرم به صورت&nbsp; صورت مدال) هدایت گردیده تا فرایند ثبت نام را انجام دهد</span></p><p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;color:#FF0000;\">در صورتی که کارجو قبلا در سامانه فرصت های شغلی ثبت نام کرده بود پس از احراز هویت به سامانه فرصت های شغلی وارد گردد و قادر باشد بر اساس رزومه ای که قبلا در مرحله ثبت نام ایجاد کرده است نسبت به ارسال رزومه برای فرصت های شغلی اقدام نماید</span></p>",P="4",Q="ba53f2e7d8f1476b87cce575623278b9",R="گروه صنایع گیتی پسند",S="<p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\">آگهی های استخدامی ثبت شده </span><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;color:#FF0000;\">دارای اعتبار </span><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\">واکشی و به صورت </span><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;color:#0016FF;\">کارت آگهی </span><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\">در این قسمت برای کارجو نمایش داده شود</span></p>",T="5",U="<p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\">پس از احراز هویت و ورود موفقیت آمیز کارجو به جای&quot;ورود | ثبت نام&quot; نام وی نمایش داده شود </span></p>",V="6",W="c33680ac51fe486e990f4514e7f2caf3",X="<p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\">در هر مرحله جهت نوتیفیکیشن یا اعلان به کارجو می توان از قسمت اعلان استفاده نمود</span></p>",Y="7",Z="<p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\">با هر تغییر در وضعیت کارجو در هر مرحله از طریق اعلان به وی اطلاع رسانی گردد</span></p>",ba="8",bb="d8e4c42cc1274d5483d2b5daf96eeaae",bc="ثبت نام تکمیلی",bd="<p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\">چنانچه رزومه(پروفایل) کارجو توسط مدیر جذب و استخدام به مرحله &quot;</span><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;color:#4B7902;\">تایید</span><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\">&quot; رفت دکمه &quot;</span><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;color:#A408BF;\">ثبت نام تکمیلی</span><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\">&quot; که حاوی لینک ثبت نام میشود در بخش &quot;اعلان(زنگوله)&quot; در پروفایل کارجو نمایش داده شده و فعال گردد.کارجو سپس با استفاده از این دکمه قادر باشد پس از احراز هویت به ثبت نام تکمیلی خود بپردازد </span></p><p><span><br></span></p>",be="9",bf="dd3bb9c406704cb786110c5e3ae39c92",bg="<p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\">پس از پایان ثبت نام تکمیلی و دریافت کد رهگیری توسط کارجو &quot;کد رهگیری&quot; دریافت شده نیز نمایش داده شود.کارجو تا قبل از مرحله &quot;ضمیمه مدارک&quot; قادر باشد تا ثبت نام تکمیلی خود را ویرایش نماید</span></p><p><span><br></span></p>",bh="11",bi="<p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\">همیشه جدیدترین و آخرین اعلان با رنگ </span><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;color:#FF0000;\">قرمز </span><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\">جهت اطلاع رسانی به کارجو نمایش داده شود</span></p>",bj="12",bk="e5b2b410a601476eb8f0287f8767ab6b",bl="شما به مصاحبه تخصصی ",bm="13",bn="<p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\">با کلیک بر روی آخرین اعلان، کارجو جهت مشاهده آخرین وضعیت خود به فرم &quot;وضعیت کارجو&quot; منتقل گردد</span></p>",bo="style",bp="baseStyle",bq="627587b6038d43cca051c114ac41ad32",br="pageAlignment",bs="center",bt="fill",bu="fillType",bv="solid",bw="color",bx=0xFFFFFFFF,by="image",bz="imageAlignment",bA="near",bB="imageRepeat",bC="auto",bD="favicon",bE="sketchFactor",bF="0",bG="colorStyle",bH="appliedColor",bI="fontName",bJ="Applied Font",bK="borderWidth",bL="borderVisibility",bM="borderFill",bN=0xFF797979,bO="cornerRadius",bP="cornerVisibility",bQ="outerShadow",bR="on",bS=false,bT="offsetX",bU=5,bV="offsetY",bW="blurRadius",bX="spread",bY="r",bZ=0,ca="g",cb="b",cc="a",cd=0.349019607843137,ce="adaptiveStyles",cf="interactionMap",cg="onLoad",ch="eventType",ci="OnPageLoad",cj="description",ck="Page Loaded",cl="cases",cm="Case 1",cn="conditionString",co="if value of Loginv equals &quot;1&quot;",cp="isNewIfGroup",cq="caseColorHex",cr="AB68FF",cs="condition",ct="exprType",cu="binaryOp",cv="op",cw="==",cx="leftExpr",cy="fcall",cz="functionName",c